// src/components/LoginSignup/LoginSignup.jsx
import React, { useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import ReCAPTCHA from 'react-google-recaptcha';
import { login, signup, forgotPassword } from '.';
import './CSS/LoginSignup.css';

const LoginSignup = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: ''
  });
  const [captchaToken, setCaptchaToken] = useState('');
  const [state, setState] = useState('Login');
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const { error } = useSelector((state) => state);

  const changeHandler = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleCaptcha = (value) => {
    setCaptchaToken(value);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!formData.email || (state !== 'Forgot Password' && !formData.password)) {
      setError('Please fill all fields');
      return;
    }

    if (!captchaToken) {
      setError('Please complete the CAPTCHA');
      return;
    }

    if (state === 'Forgot Password') {
      dispatch(forgotPassword(formData.email, captchaToken));
      alert('Password reset email sent if the email exists.');
    } else {
      const action = state === 'Login' ? login : signup;
      dispatch(action(formData, captchaToken));
    }
  };

  React.useEffect(() => {
    const { token } = useSelector((state) => state);
    if (token) navigate('/home');
  }, [navigate]);

  return (
    <div className="loginsignup">
      <div className="loginsignup-container">
        <h1>{state}</h1>
        <form onSubmit={handleSubmit}>
          <div className="loginsignup-fields">
            {state === "Sign Up" && (
              <input
                type="text"
                placeholder="Your Name"
                name="username"
                value={formData.username}
                onChange={changeHandler}
              />
            )}
            <input
              type="email"
              placeholder="Email Address"
              name="email"
              value={formData.email}
              onChange={changeHandler}
            />
            {state !== "Forgot Password" && (
              <input
                type="password"
                placeholder="Password"
                name="password"
                value={formData.password}
                onChange={changeHandler}
              />
            )}
          </div>

          <ReCAPTCHA
            sitekey="6LeSAz0qAAAAAB-Bq9xTnXnQDi0W5rZnfAzr3D0l" // Replace with your reCAPTCHA site key
            onChange={handleCaptcha}
          />

          <button type="submit">Continue</button>

          {state === "Login" ? (
            <>
              <p className="loginsignup-login">
                Don't have an account? <span onClick={() => setState("Sign Up")}>Sign up here</span>
              </p>
              <p className="loginsignup-login">
                Forgot your password? <span onClick={() => setState("Forgot Password")}>Click here</span>
              </p>
            </>
          ) : state === "Sign Up" ? (
            <p className="loginsignup-login">
              Already have an account? <span onClick={() => setState("Login")}>Login here</span>
            </p>
          ) : (
            <p className="loginsignup-login">
              Remembered your password? <span onClick={() => setState("Login")}>Login here</span>
            </p>
          )}

          <div className="loginsignup-agree">
            <input type="checkbox" name="agree" id="agree" />
            <p>By continuing, I agree to the terms of use & privacy policy.</p>
          </div>

          {error && <p className="loginsignup-error">{error}</p>}
        </form>
      </div>
    </div>
  );
};

export default LoginSignup;
